const Home = () => {
  return (
    <div>
      <h3 className="text-center my-3">Welcome to the News Website</h3>
      <p>This website provides the latest news in various categories including Technology, Sports, Politics, and International. Stay updated with the current events and news stories around the world.</p>
    </div>
  );
};

export default Home;
